import React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';

export default function ImageGrid() {
    const itemData = Array.from(Array(9).keys()).map((index) => ({
        img: `/p${index + 1}.png`, // Assuming images are named p1.png to p9.png in the public folder
        title: `Image ${index + 1}`,
    }));

    const itemHeight = 700 / 3; // Assuming total height of ImageList is 700px and 3 rows

    return (
        <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', width: '40%', padding: '20px', overflow: 'hidden' }}>
            <ImageList sx={{ width: '100%', height: '100%', overflowY: 'auto' }} cols={3} rowHeight={itemHeight}>
                {itemData.map((item) => (
                    <ImageListItem key={item.img}>
                        <img
                            src={item.img}
                            alt={item.title}
                            loading="lazy"
                            style={{ width: '100%', height: '100%', objectFit: 'cover' }}
                        />
                    </ImageListItem>
                ))}
            </ImageList>
        </div>
    );
}
